import React from "react";
import styles from './styles.js';

export const Footer = () => {
    return <>
    <h4 style={{ margin: 0 }}>
                     TURTLE FUNCTIONS
                </h4>

                 <div style={{ ...styles.row, ...styles.spacer}}>
                     {moveArray.map((key) =>
                         <button
                             key={key}
                             onClick={() => turtle[key]()}
                             style={styles.button}
                         >
                             {key}
                         </button>
                     )}
                 </div>
                 <div style={{ ...styles.row, maxWidth: width - 48 }}>
                         <button
                         onClick={() => turtle.hexagon()}
                        style={styles.blueButton}
                    >
                        Hexagon
                    </button>
              </div>
    </>
};
